import './main-panel-header.css';

export const MainPanelHeader = (onClick) => {
    return (
        <div className='header-container'>
            <p className='text'>Students List</p>
            <div className='add-new-student-button' onClick={() => onClick}>
                <p className='button-text'>ADD NEW STUDENT</p>
            </div>
        </div>
    )
}
